	public static string GetConfig(TextFxAnimationManager.PRESET_ANIMATION_SECTION section, string animName)
	{
		animName = animName.Trim();

		Dictionary<string, string> configDictionary = null;

		switch(section)
		{
			case TextFxAnimationManager.PRESET_ANIMATION_SECTION.INTRO:
				configDictionary = m_intros;
				break;
			case TextFxAnimationManager.PRESET_ANIMATION_SECTION.MAIN:
				configDictionary = m_mains;
				break;
			case TextFxAnimationManager.PRESET_ANIMATION_SECTION.OUTRO:
				configDictionary = m_outros;
				break;
		}

		if(configDictionary != null && configDictionary.ContainsKey(animName))
			return configDictionary[animName];
		else
			return "";
	}
